#define SCRIPT_FUNC_TABLE_SIZE (sizeof(sScriptFuncTable) / sizeof(sScriptFuncTable[0]))

/**
 * Look up a PC function pointer from a GBA Thumb address.
 * Returns NULL if not found.
 */
void* Port_LookupScriptFunc(u32 gba_addr) {
    int lo = 0, hi = SCRIPT_FUNC_TABLE_SIZE - 1;
    while (lo <= hi) {
        int mid = (lo + hi) / 2;
        if (sScriptFuncTable[mid].gba_addr == gba_addr)
            return (void*)sScriptFuncTable[mid].func;
        else if (sScriptFuncTable[mid].gba_addr < gba_addr)
            lo = mid + 1;
        else
            hi = mid - 1;
    }
    return NULL;
}
